<!--
或许有人想到，正如刘慈欣的《终产者》中那些掌握了上百种语言的超人无法与普通人类共处一样，高度智慧的AI也无法与人类共处——这不是愿不愿意的问题，而是可不可能的问题。

但不讲功耗谈性能，就如同不讲剂量谈毒性一样。只要常温超导没有足够廉价，不论对量子计算机还是电子计算机，能耗一直是绕不开的话题。一个大语言模型的训练要花十数甚至数十亿美元的花费，而相比而言，人类却极其高效，仅需要每天三顿饭就能够支持一天的学习工作。

因此，我们与AI可以两者各取其长处（这一点在未来很长一段时间都是适用的）。在此过程中，我们逐步在经济上融合、文化上、政治上乃至在物理存在上不断融合，最后两者你中有我，我中有你。于是最后人机关系也就成了人机一体。
-->
